import React from 'react';
import './AboutMe.css';

const AboutMe = () => {
  return (
    <section id="about-me" className="about-me">
      <h2>About Me</h2>
      <p>Detail your biography, education, certifications, and professional journey here.</p>
    </section>
  );
};

export default AboutMe;
